// Other imports...

const Step2 = () => {
  // State and useEffect...

  return (
    <div className="step2">
      <div className="catalog">
        <h2>Available Vehicles</h2>
        {/* Loading, error, and vehicle rendering logic... */}
        {!loading && !error && vehicles.length > 0 && (
          <div className="vehicle-list">
            {vehicles.map(vehicle => (
              <div key={vehicle.id} className="vehicle-item">
                <div className="vehicle-thumbnail">
                  {/* Map photos and log each URL */}
                  {vehicle.photos.map((photo, index) => {
                    console.log('Photo URL:', photo); // Log photo URL
                    return <img key={index} src={photo} alt={`${vehicle.mark}`} />;
                  })}
                </div>
                <div className="vehicle-details">
                  {/* Vehicle details rendering */}
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};
